type:
∀ {Nat : Type} {zero : Nat} {succ : Nat → Nat} {succ_ne : ∀ (n : Nat), Ne (succ n) zero}
  {succ_cancel : ∀ {n m : Nat}, Eq (succ n) (succ m) → Eq n m}
  {induction : ∀ (P : Nat → Prop), P zero → (∀ (n : Nat), P n → P (succ n)) → ∀ (n : Nat), P n} {Nat_1 : Type}
  {zero_1 : Nat_1} {succ_1 : Nat_1 → Nat_1} {succ_ne_1 : ∀ (n : Nat_1), Ne (succ_1 n) zero_1}
  {succ_cancel_1 : ∀ {n m : Nat_1}, Eq (succ_1 n) (succ_1 m) → Eq n m}
  {induction_1 : ∀ (P : Nat_1 → Prop), P zero_1 → (∀ (n : Nat_1), P n → P (succ_1 n)) → ∀ (n : Nat_1), P n},
  Eq { Nat := Nat, zero := zero, succ := succ, succ_ne := succ_ne, succ_cancel := succ_cancel, induction := induction }
      { Nat := Nat_1, zero := zero_1, succ := succ_1, succ_ne := succ_ne_1, succ_cancel := succ_cancel_1,
        induction := induction_1 } →
    And (Eq Nat Nat_1) (And (HEq zero zero_1) (HEq succ succ_1))
